import React, { useState } from "react";

const LoginLogout = () => {
  // Store user info after signup
  const [registeredUser, setRegisteredUser] = useState(null);

  // Current login state
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  // Form fields
  const [formData, setFormData] = useState({ name: "", email: "" });

  // Toggle between 'signup' and 'login' views
  const [mode, setMode] = useState("signup"); // or 'login'

  // Handle form field changes
  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  // Sign up handler
  const handleSignUp = (e) => {
    e.preventDefault();
    if (formData.name.trim() === "" || formData.email.trim() === "") {
      alert("Please enter name and email.");
      return;
    }
    setRegisteredUser({ ...formData });
    setIsLoggedIn(true);
  };

  // Login handler
  const handleLogin = (e) => {
    e.preventDefault();
    if (!registeredUser) {
      alert("No registered user found. Please sign up first.");
      return;
    }
    if (formData.email.trim() === registeredUser.email) {
      setIsLoggedIn(true);
    } else {
      alert("Email not recognized. Please try again or sign up.");
    }
  };

  // Logout handler
  const handleLogout = () => {
    setIsLoggedIn(false);
    setFormData({ name: "", email: "" });
  };

  return (
    <div className="max-w-md mx-auto p-6 bg-white rounded-lg shadow-lg mt-10">
      {isLoggedIn && registeredUser ? (
        <div className="text-center">
          <h2 className="text-2xl font-semibold mb-4 text-green-600">
            Welcome, {registeredUser.name}!
          </h2>
          <p className="mb-6 text-gray-700">Email: {registeredUser.email}</p>
          <button
            onClick={handleLogout}
            className="bg-red-500 hover:bg-red-600 text-white px-6 py-2 rounded shadow"
          >
            Logout
          </button>
        </div>
      ) : (
        <div>
          <div className="flex justify-center space-x-4 mb-6">
            <button
              onClick={() => setMode("signup")}
              className={`px-4 py-2 rounded ${
                mode === "signup"
                  ? "bg-blue-600 text-white"
                  : "bg-gray-200 text-gray-700"
              }`}
            >
              Sign Up
            </button>
            <button
              onClick={() => setMode("login")}
              className={`px-4 py-2 rounded ${
                mode === "login"
                  ? "bg-blue-600 text-white"
                  : "bg-gray-200 text-gray-700"
              }`}
            >
              Login
            </button>
          </div>

          {mode === "signup" ? (
            <form onSubmit={handleSignUp} className="space-y-5">
              <div>
                <label className="block text-sm font-medium text-gray-700">
                  Name
                </label>
                <input
                  type="text"
                  name="name"
                  placeholder="Enter your name"
                  value={formData.name}
                  onChange={handleChange}
                  className="mt-1 w-full px-4 py-2 border rounded-md focus:outline-none focus:ring focus:ring-blue-300"
                  required
                />
              </div>
              <div>
                <label className="block text-sm font-medium text-gray-700">
                  Email
                </label>
                <input
                  type="email"
                  name="email"
                  placeholder="Enter your email"
                  value={formData.email}
                  onChange={handleChange}
                  className="mt-1 w-full px-4 py-2 border rounded-md focus:outline-none focus:ring focus:ring-blue-300"
                  required
                />
              </div>
              <button
                type="submit"
                className="w-full bg-blue-600 hover:bg-blue-700 text-white py-2 rounded shadow"
              >
                Sign Up
              </button>
            </form>
          ) : (
            <form onSubmit={handleLogin} className="space-y-5">
              <div>
                <label className="block text-sm font-medium text-gray-700">
                  Email
                </label>
                <input
                  type="email"
                  name="email"
                  placeholder="Enter your registered email"
                  value={formData.email}
                  onChange={handleChange}
                  className="mt-1 w-full px-4 py-2 border rounded-md focus:outline-none focus:ring focus:ring-blue-300"
                  required
                />
              </div>
              <button
                type="submit"
                className="w-full bg-blue-600 hover:bg-blue-700 text-white py-2 rounded shadow"
              >
                Login
              </button>
            </form>
          )}
        </div>
      )}
    </div>
  );
};

export default LoginLogout;
